  const [data1,setdata1]=useState([])
  axios.get("https://carpsapi-production.up.railway.app/showdb").then((response)=>{
    setdata1(response.data)
  }).catch((error)=>{
    console.log(error);
  })
  console.log(data1);
  return (
    <>
    <div className="header">
      <h1>Car Parking System</h1>
    </div>
    <div className="free-slots">
      <h1>Free Slots</h1>

        {data1.map((datax,e)=>{
          return(
            data1[e].status==1 &&
              <p>{data1[e].slot_id+"  "+data1[e].status}</p>


          )

        })}

    </div>
    <div className='roadmap1'>
      <h1>Slot Map</h1>
      <div className='roadmap'>
      {data1.map((datax,e)=>{
          return(


              <>
              <div className='carslot'>
              <div className='whitestrip'></div>
          <img src='https://www.seekpng.com/png/full/257-2576097_car-red-vehicle-automobile-auto-car-clipart-top.png'/>
          <div className='whitestrip'></div>
        </div>
              </>



          )

        })}





      </div>


    </div>

    </>
  );
}

export default App;
